import React from 'react'
import Button from '@mui/material/Button'
import DeleteIcon from '@mui/icons-material/Delete'
import Box from '@mui/material/Box';
import Typography from '@mui/material/Typography';
import { Container } from '@mui/material';
function Login () {
return <>
<Typography variant="h1" component="h2">App con typography h1</Typography>
<Typography variant="h2" component="h3">App con typography h2</Typography>
<Typography variant="h3" component="h4">App con typography h3</Typography>


<Container>
<Button color="secondary" variant="contained" onClick={() => {
    alert('clicked');
  }}> Boton </Button>

<Button color="primary" variant="text" onClick={() => {
    alert('clicked');
  }}> Boton </Button>

<Button color="secondary" variant="outlined" onClick={() => {
    alert('clicked');
  }}> Boton </Button>


</Container>
</>
}
export default Login
